import React, { Component } from 'react'
import BackComponent from "../Components/BackComponent";
import DetailComponent from '../Components/DetailComponent';


export default class DetailContainer extends Component {
    render() {
        return (
            <div>
                        <BackComponent />
                        <DetailComponent />
            </div>
        )
    }
}
